@kennknowles 
> To do the last one, you need to be able to get the DoFnSignature from a DoFnInvoker. You probably don't actually need the DoFn.

We are able to get `DoFn` from `DoFnInvoker` now so `DoFnSignature` is also available. `DoFn` is needed to create `ProcessContext` in `DoFnRunner`.
